import React, { Fragment, useEffect, useState } from 'react';
import Breadcrumb from "../../common/breadcrumb";
import MaterialTable from "material-table";
import { useDispatch, useSelector } from "react-redux";
import axios from "axios";
import CancelIcon from '@material-ui/icons/Cancel';
import EditIcon from '@material-ui/icons/Edit';
import imagen1 from "../../../assets/images/imagenes/bicicleta.jpg";
import imagen2 from "../../../assets/images/imagenes/bolsa.jpg";
import imagen3 from "../../../assets/images/imagenes/camisetas.jpg";
import imagen4 from "../../../assets/images/imagenes/camisetas1.jpg";
import imagen5 from "../../../assets/images/imagenes/caramañola.jpg";
import imagen6 from "../../../assets/images/imagenes/caramañola1.jpg";
import imagen7 from "../../../assets/images/imagenes/caramañola2.jpg";
import imagen8 from "../../../assets/images/imagenes/casco1.jpg";
import imagen9 from "../../../assets/images/imagenes/sillin.jpg";
import imagen10 from "../../../assets/images/imagenes/sillin1.jpg";
import imagen11 from "../../../assets/images/imagenes/sillin3.jpg";
import imagen12 from "../../../assets/images/imagenes/zapatillas.jpg";
import imagen13 from "../../../assets/images/imagenes/zapatillas1.jpg";
import imagen14 from "../../../assets/images/imagenes/zapatillas2.jpg";
import imagen15 from "../../../assets/images/imagenes/zapatillas3.jpg";
import imagen16 from "../../../assets/images/imagenes/casco.jpg";

function ListarProductos(props) {
    const [listProductos, setListProductos] = useState([]);
    const dispatch = useDispatch();
    const [tem1, setTem1] = useState(imagen1);
    const [tem2, setTem2] = useState(imagen2);
    console.log("IMAGEN : ", imagen1)

    useEffect(() => {
        const leerProductos = async () => {
            await axios({
                method: 'post',
                url: 'https://sitbusiness.co/cyclewear/api/23'
            }).then(res => {
                console.log("LISTA DE  PRODUCTOS : ", res.data);

                {
                    res.data && res.data.map((productos, index) => {
                        {
                            let imagen = 0;
                            if (productos.value === 1) {
                                imagen = imagen1;
                            } else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 3) {
                                imagen = imagen3;
                            }  else
                            if (productos.value === 4) {
                                imagen = imagen4;
                            }  else
                            if (productos.value === 5) {
                                imagen = imagen5;
                            }  else
                            if (productos.value === 6) {
                                imagen = imagen6;
                            }  else
                            if (productos.value === 7) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }  else
                            if (productos.value === 2) {
                                imagen = imagen2;
                            }

                            if (informecostos.tipogasto == "2")
                                logistica = informecostos.costomtto;
                            else
                                contrataciones = informecostos.costomtto;
                            //if (informecostos.tipogasto == "2")
                                
                            if (informecostos.valorrentames_ctr < 10)
                                rentames = 1;
                            else
                                rentames = informecostos.valorrentames_ctr;

                            rentabilidad = rentames -
                                (gas + gasolina + peajes + insumos + informecostos.costomtto + informecostos.costototal_cre + 0 +
                                    informecostos.depreciacionmensual_act + 0 + softwaremtto + nomina + rentingcamioneta +
                                    motocarro + motocubico + lineacelular + (informecostos.valorcomercial_seg * 0.009 * 0.0821917));

                            totalgastos = (gas + gasolina + peajes + insumos + informecostos.costomtto + informecostos.costototal_cre + 0 +
                                informecostos.depreciacionmensual_act + 0 + softwaremtto + nomina + rentingcamioneta +
                                motocarro + motocubico + lineacelular + (informecostos.valorcomercial_seg * 0.009 * 0.0821917));

                            return (
                                <tr>
                                    <td>{informecostos.codigo_equ}</td>
                                    <td>{anno}</td>
                                    <td>{mes}</td>
                                    <td>{informecostos.valorenlibros_act}</td>
                                    <td>{rentames}</td>
                                    <td>{gas}</td>
                                    <td>{gasolina}</td>
                                    <td>{peajes}</td>
                                    <td>{insumos}</td>
                                    <td>{contrataciones}</td>
                                    <td>{informecostos.costototal_cre}</td>
                                    <td>{logistica}</td>
                                    <td>{0}</td>
                                    <td>{informecostos.valorcomercial_seg}</td>
                                    <td>{Math.round(informecostos.valorcomercial_seg * 0.009 * 0.0821917)}</td>
                                    <td>{0}</td>
                                    <td>{softwaremtto}</td>
                                    <td>{nomina}</td>
                                    <td>{rentingcamioneta}</td>
                                    <td>{motocarro}</td>
                                    <td>{motocubico}</td>
                                    <td>{lineacelular}</td>
                                    <td>{totalgastos}</td>
                                    <td>{rentabilidad}</td>
                                </tr>
                            )
                        }
                    })
                }





                setListProductos(res.data);
            }
            ).catch(function (error) {
                console.log("ERROR LEYENDO LISTA DE PRODUCTOS");
            })
        }
        leerProductos();
    }, []);

    const columnas = [
        { 
            title: '',
            field: 'imageUrl',
            render: rowData => <img src={rowData.img} style={{ width: 100, height: 100 }} /> },
        { 
            title: 'Tipo', 
            field: 'nombretipoproducto' 
        },
        { 
            title: 'CategoríaUno',
            field: 'nombrecategoriauno' 
        },
        { 
            title: 'CategoríaDos',
            field: 'nombrecategoriauno'
        },
        {
            title: 'CategoríaTres',
            field: 'nombrecategoriados'
        },
        {
            title: 'CategoríaTres',
            field: 'nombrecategoriatres'
        }
    ]

    const datos = {
        name: 'Mehmet', surname: 'Baran', birthYear: 1987, birthCity: 63, imageUrl: 'https://avatars0.githubusercontent.com/u/7895451?s=460&v=4',
        name: 'Zerya Betül', surname: 'Baran', birthYear: 2017, birthCity: 34, imageUrl: 'https://avatars0.githubusercontent.com/u/7895451?s=460&v=4',
    }


    return (
        <Fragment>
            <Breadcrumb title="Listar Productos" parent="Physical" />
            <div id="basicScenario" className="product-physical">
                <MaterialTable
                    title="Render Image Preview"
                    columns={columnas}
                    data={listProductos}
                />
            </div>

        </Fragment>
    );
}

export default ListarProductos;
